import React from 'react';
import pic from './rancell.JPG';

const Photo = () => {
    return ( 

        <div className="col-12 col-sm-6 col-md-4 col-lg-3 mb-4" >
            <img src = {pic} className = "card-img-top" />

        </div>

     );
}

export default Photo;
